"description\":\"Family and Life Stages\"}},{\"domain\":{\"id\":\"66\",\"name\":\"Interests and Hobbies Category\",\"description\":\"A grouping of interests and hobbies entities, like Novelty Food or Destinations\"},\"entity\":{\"id\":\"864925760624091136\",\"name\":\"Babies and toddlers\",\"description\":\"Babies and toddlers\"}}],\"source\":\"Twitter Web App\",\"attachments\":{\"media_keys\":[\"3_1399940794883067904\"]},\"conversation_id\":\"1399941552995139586\",\"lang\":\"en\",\"created_at\":\"2021-06-02T04:10:50.000Z\",\"entities\":{\"hashtags\":[{\"start\":223,\"end\":236,\"tag\":\"EveryNewborn\"},{\"start\":238,\"end\":249,\"tag\":\"SkintoSkin\"}],\"urls\":[{\"start\":197,\"end\":220,\"url\":\"https://t.co/cgx3PuvTkO\",\"expanded_url\":\"http://bit.ly/3wKGz2b\",\"display_url\":\"bit.ly/3wKGz2b\",\"images\":[{\"url\":\"https://pbs.twimg.com/news_img/1405870037739753472/mHNMuEdU?format=jpg&name=orig\",\"width\":1200,\"height\":459},{\"url\":\"https://pbs.twimg.com/news_img/1405870037739753472/mHNMuEdU?format=jpg&name=150x150\",\"width\":150,\"height\":150}],\"status\":200,\"title\":\"Kangaroo mother care started immediately after birth critical for saving lives, new research shows\",\"description\":\"Immediate kangaroo mother care for preterm and low birthweight babies requires dedicated Mother-Newborn Intensive Care Units GENEVA, 27 May 2021Kangaroo mother care, which involves skin-to-skin contact and exclusive breastfeeding, significantly improves a premature or low birthweight baby’s chances of survival Starting kangaroo mother care immediately after birth has the potential to save up to 150,000 more lives each year, compared with the current recommendation of starting it only once a baby is stableMother-Newborn Intensive Care Units (ICUs) will be critical to support the mother, or a surrogate, in providing this immediate, ongoing skin-to-skin contact from birth. The results of a new clinical trial published today in the New England Journal of Medicine, show that immediate kangaroo mother care, which involves skin-to-skin contact with the mother and exclusive breastfeeding, started as soon as a preterm or low birthweight baby is born, dramatically improves survival. Current Worl\",\"unwound_url\":\"https://www.who.int/news/item/26-05-2021-kangaroo-mother-care-started-immediately-after-birth-critical-for-saving-lives-new-research-shows\"},{\"start\":250,\"end\":273,\"url\":\"https://t.co/rbl2GVNKmF\",\"expanded_url\":\"https://twitter.com/WHOWPRO/status/1399941552995139586/photo/1\",\"display_url\":\"pic.twitter.com/rbl2GVNKmF\"}]},\"public_metrics\":{\"retweet_count\":10,\"reply_count\":0,\"like_count\":23,\"quote_count\":0},\"author_id\":\"3794682452\",\"text\":\"When started at the soonest possible time, kangaroo mother care can sav even more lives, improve health outcomes for babies and bolster the emotional wellbeing of their families.\\n\\nLearn more here: https://t.co/cgx3PuvTkO \\n\\n#EveryNewborn \\n#SkintoSkin https://t.co/rbl2GVNKmF\",\"id\":\"1399941552995139586\",\"possibly_sensitive\":false},{\"entities\":{\"annotations\":[{\"start\":0,\"end\":2,\"probability\":0.7105,\"type\":\"Organization\",\"normalized_text\":\"CDC\"}],\"hashtags\":[{\"start\":72,\"end\":85,\"tag\":\"PublicHealth\"},{\"start\":158,\"end\":175,\"tag\":\"DiseaseDetective\"}],\"urls\":[{\"start\":177,\"end\":200,\"url\":\"https://t.co/keaIG3Vbz9\",\"expanded_url\":\"http://bit.ly/ApplytoEIS\",\"display_url\":\"bit.ly/ApplytoEIS\"},{\"start\":202,\"end\":225,\"url\":\"https://t.co/sob9T6f97i\",\"expanded_url\":\"https://twitter.com/CDCgov/status/1400114996051427328/photo/1\",\"display_url\":\"pic.twitter.com/sob9T6f97i\"}]},\"source\":\"Sprout Social\",\"attachments\":{\"media_keys\":[\"3_1400114992775581699\"]},\"conversation_id\":\"1400114996051427328\",\"lang\":\"en\",\"created_at\":\"2021-06-02T15:40:02.000Z\",\"public_metrics\":{\"retweet_count\":47,\"reply_count\":8,\"like_count\":94,\"quote_count\":7},\"author_id\":\"146569971\",\"t